        <div class = "border">
          <img class = "img-thumbnail" src = {require("./restaurant_photos/ihop.jpg")} style = {this.styles.image}/>
          <NavLink to='/IHOP'>
          <h2>IHOP</h2>
          </NavLink>
        </div>



      </div>
    )
  }
}

export default restaurant
